import React from "react";
import "./Header.scss";
import { Link } from "react-router-dom";

function Header() {
  return (
    <section className="nav-bar">
      <nav className="nav">
        <h1 className="nav__logo">metaSHOP</h1>
        <div className="nav__user">
          <Link to="/users/shop" className="nav__user--link shop">
            SHOP
          </Link>
          <Link to="/users/login" className="nav__user--link login">
            ABOUT US
          </Link>
          <Link to="/users/:id/cart" className="nav__user--link cart">
            BEST SELLERS
          </Link>
          <Link to="/users/:id/cart" className="nav__user--link cart">
            CONTACT
          </Link>
        </div>
      </nav>
    </section>
  );
}

export default Header;
